import React from "react";

function Header(props) {
  console.log(props.standings);
  return (
    <div className="navBar">
      <img src={props.logo} className="logo" alt="csgo_logo"></img>
      <div className="navButton">Set</div>
    </div>
  );
}

export default Header;
